import React from 'react';

const Header = () => {
  return (
    <header>
      <div className="nav-container">
        <a href="#">ACCUEIL</a>
        <a href="#">SHOP</a>
        <a href="#">A PROPOS</a>
        <a href="#">CONTACT</a>
        <a href="#">BLOG</a>
      </div>
    </header>
  )
}

export default Header;
